import './ExerciseList.scss';
import Exercise from './Exercise';
import React, { useEffect, useState } from "react";

const WorkoutData = () => {
  const [data, setData] = useState([])
  const getData = async () => {
    const result = await fetch('http://localhost:3000/workouts')
    const data = await result.json()
    setData(data)
  }
}


var listItems = WorkoutData.workouts.map(item =>
    <Exercise 
      id={ item.id } 
      name={ item.name } 
      type={ item.type } 
      timing={ item.timing } 
      target={ item.target } 
    />
);

const one = 12;


function ExerciseList() {
  return (
    <div className="ExerciseList">
            <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Type</th>
            <th>Timing</th>
            <th>Target Area</th>
          </tr>
        </thead>
        <tbody>
          { listItems }
        </tbody>
        </table>

        <button>Add Exercise</button>
    </div>
  );
}

export default ExerciseList;
